const data = [
    ["Element", "Density", { role: "style" }],
    ["Critical", 21, "red"], // RGB value
    ["High", 74, "orange"], // English color name
    ["Medium", 155, "yellow"],
     // CSS-style declaration
  ];

  export default data;
